import React from 'react'

import axios from "axios";
import { BaseUrl } from "../../helpers/base_url";
import Table from "../../components/table/Table";
import { useState } from 'react';
const Orders =()=>{
    const [listOrder,setlistOrder]=useState([])
    const customerTableHead = ["", "date", "note","price","user","meal number"];
    const renderHead = (item, index) => <th key={index}>{item}</th>;
    const renderOrderBody = (item, index) => (
        <tr key={index}>
          <td className=" col-1">{item}</td>
    
          <td>
            <button className="button col-3">Edit</button>
          </td>
        </tr>
      );
    React.useEffect( () => {
       axios.get(BaseUrl+"/command/getall/byrestaurantid/"+localStorage.getItem("restaurant_id"))
       .then((response) => {
            console.log(response.data)
            setlistOrder(response.data)
       }
        )
    },[])
    return(
        
        <div className="col-8">
             <h2 className="page-header">
                Orders
            </h2>
       
    </div>
    )

}

export default Orders
